fields.schema:
{
    "schema": 
    {
        "$schema": "http://json-schema.org/draft-04/schema#",
        "title": "EventType Test Data",

        "type": "object",

        "properties": 
        {
            "conservancy": {
                "type":"string",
                "title": "Conservancy",
                "enum": {{enum___conservancy___values}},
                "enumNames": {{enum___conservancy___names}}
            },
			"sectionArea": {
				"type": "string",
				"title": "Section/Area",
				"enum": {{enum___sectionArea___values}},
				"enumNames": {{enum___sectionArea___names}}
			},			
			"arrestrep_reasonforarrest": {
				"type": "array",
				"title": "Reason for Arrest",
                "items": {
                    "type": "string",
				    "enum": {{enum___arrestrep_reasonforarrest___values}},
				    "enumNames": {{enum___arrestrep_reasonforarrest___names}}
                },
                "uniqueItems": true
			},
         "nameofranger": {
                "type": "string",
                "title": "Name Of Ranger",
                "enum": {{query___rangers___values}},
                "enumNames": {{query___rangers___names}}                    
         },
        "carcassrep_species": {
			},
        "beginning_of_incident": {
            "type": "string",
            "title": "Beginning of Incident"
        },
        "end_of_incident": {
            "type": "string",
            "title": "End of Incident"
        },
        "details": {
	    "type": "string",
	    "title": "Details"
        },
        "results_and_findings": {
            "type": "string",
            "title": "Results and Findings"
        },
        "action_items": {
            "type": "string",
            "title": "Action Items"
        }
    }
  },
  "definition": [
   {
         "key": "conservancy",
        "htmlClass": "col-lg-6"  
  },
    {
        "key": "sectionArea",
        "fieldHtmlClass": "multiple-select",
        "htmlClass": "col-lg-6"  
    },
    {
        "key": "arrestrep_reasonforarrest",
        "fieldHtmlClass": "multiple-select",
        "htmlClass": "col-lg-6"  
    },
   {
        "key":    "nameofranger",
        "htmlClass": "col-lg-6"  
    },
    {
			"key": "carcassrep_species",
			"type": "checkboxes",
			"title": "Species",
			"titleMap": {{enum___carcassrep_species___map}}
		},
    {
      "key": "beginning_of_incident",
      "fieldHtmlClass": "date-time-picker json-schema",
      "readonly": false,
        "htmlClass": "col-lg-6"  
    },
    {
      "key": "end_of_incident",
      "fieldHtmlClass": "date-time-picker json-schema",
      "readonly": false,
        "htmlClass": "col-lg-6"  
    },
{
     "key":    "details",
        "htmlClass": "col-lg-6"  
},
{
"key":     "results_and_findings",
        "htmlClass": "col-lg-6"  
},
{
  "key":   "action_items",
        "htmlClass": "col-lg-6"  
}
  ]
}
